import React from 'react';



export function Roadmap() {

  return (
      <div className='container'>
        <div className='col'>
            <h3 style={{fontSize: '25px'}}>Roadmap</h3>
        </div>
        <div style={{maxWidth: '500px', minWidth:'300px'}}>
          <div className='roadmap'>Doggo ipsum long bois lotsa pats blep. What a nice floof ruff super chub very good spot, the neighborhood pupper lotsa pats. Borkdrive shibe shoober what a nice floof, borking doggo.</div>
          <div className='roadmap'>Shoober shooberino adorable doggo many pats, heckin good boys many pats pupper wrinkler, corgo maximum borkdrive. A frighten puggo wow very biscit.</div>
          <div className='roadmap'>Big ol h*ck adorable doggo vvv smol borking doggo with a long snoot for pats big ol, he made many woofs doing me a frighten puggo wow very biscit, ruff fat boi ruff long doggo. </div>
          <div className='roadmap'>Long bois mlem I am bekom fat wrinkler puggo maximum borkdrive big ol pupper I am bekom fat, fluffer vvv adorable doggo lotsa pats snoot. I am bekom fat ur givin me a spook length boy wow very biscit very good spot.</div>
          <div className='roadmap'>Doggo ipsum long bois lotsa pats blep. What a nice floof ruff super chub very good spot, the neighborhood pupper lotsa pats. Borkdrive shibe shoober what a nice floof, borking doggo.</div>
        </div>
      </div>
  );
}
